import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Modal from '@material-ui/core/Modal';
import Backdrop from '@material-ui/core/Backdrop';
import Fade from '@material-ui/core/Fade';
import TextField from '@material-ui/core/TextField';


const useStyles = makeStyles((theme) => ({
  modal: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  paper: {
    backgroundColor: theme.palette.background.paper,
    border: '2px solid #000',
    boxShadow: theme.shadows[5],
    padding: theme.spacing(2, 4, 3),
  },
}));

export const TransitionsModal = () => {
  const classes = useStyles();
  const [open, setOpen] = React.useState(false);

  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div className='Modal__password'>
      <button type="button" onClick={handleOpen}>
          Đổi mật khẩu
      </button>
      <Modal
        aria-labelledby="transition-modal-title"
        aria-describedby="transition-modal-description"
        className={classes.modal}
        open={open}
        onClose={handleClose}
        closeAfterTransition
        BackdropComponent={Backdrop}
        BackdropProps={{
          timeout: 500,
        }}
      >
        <Fade in={open}>
          <div className={classes.paper}>
              <div className="Modal__password">
                  <div className="title">
                      <h2>Thay đổi mật khẩu của bạn</h2>
                  </div>
                  <div className="content">
                      <div className="password__new">
                          <h3>Nhập mật khẩu hiện tại của bạn</h3>
                      </div>
                      <div className="psssword__old">
                          <h3>Nhập mật khẩu mới của bạn</h3>
                      </div>
                  </div>
              </div>
          </div>
        </Fade>
      </Modal>
    </div>
  );
}
